import React, {Component} from 'react'

class Datetime extends Component {
    state={
        date:new Date ()
    };
    callMe() {
        setInterval(()=>{
            this.setState({date: new Date ()});
        }, 1000);
    }
    render () {
        return (
            <div className="App">
                <h4>Current Time</h4>
                <h4>Iis {this.props.date.toLocaletimeString()}</h4>
                {this.callMe()}
            </div>
        );
    }
}

export default Datetime;
